import './style.css';
import "./Profile.css";

export default function Header({props}) {


    return (
          
    <div className = "header-box">
    <div className = "header">

      <img className = "header-image" src = {props.src}/>

      <div className = "header-info">
          <div className = "header-type">{props.name}</div>
          <div className = "header-title">{title}</div>
          <div className = "header-desc">Use Prototype In Figma</div>
      </div>

    </div>

  </div>
    );
}
